  false,\n\t\"url\": null,\n\t\"notes\": \"The 2010 Tree canopy GIS layer was derived
  from 4 band, 1 M resolution, Color Infrared (CIR), 2010 NAIP aerial imagery, using
  supervised image classification techniques. The National Agriculture Imagery Program
  (NAIP) acquires aerial imagery during the agricultural growing seasons in the continental
  U.S. NAIP is administered by the USDA's Farm Service Agency (FSA) through the Aerial
  Photography Field Office in Salt Lake City. This \"leaf-on\" imagery is used as
  a base layer for GIS programs in FSA's County Service Centers, and is used to maintain
  the Common Land Unit (CLU) boundaries. For planning purposes only, does not represent
  individual trees. Dataset does not account for individual tree species or any metric
  for tree canopy height. No warranty is made by the City regarding accuracy or completeness.\",\n\t\"license_title\":
